CHEESEHEAD 2019 project documentation is included in this dataset and it includes: * Experimental design, proposal narrative, airborne operations summary, data variable summary, main data sources, teleconference notes, instrumentation table; 

 * Information related to the flux towers include site metadata, site characterization and imagery, quicklooks of wind roses, flux footprints, quality control metrics, and eddy fluxes; 

 * Field logs from HySPEX hyperspectral imaging flights; 

 * Field notes from investigators during intensives; 

 * Google Earth KML and PDF maps of tower and site locations; 

 * Documents and logs related to Jackson State mobile meteorology transects; 

 * Field notes from NOAA ATDD drone sampling of meteorology and land surface temperature; 

 * Protocol documents and datasheets from autumn phenology observations; 

 * Curated collection of contributed photos and those taken by University of WI communications; 

 * Flight catalog, recorded waypoints, flight track screenshots, and experimental protocol documents related to U Wyoming King Air eddy covariance flights. This documentation is provided as a set in a single gzipped tar file. The associated readme file shows the directory layout.
